import React, {Suspense, useEffect,useState} from 'react';
import './Header.css';
import '../index.css';

function Navlinks(){

    const linksList = [
        {link: 'linkOne',linkName:'Readme'},
        {link: 'linkTwo',linkName:'Quicksteps'}
    ]

    return(
        <>
            <ul>
                {linksList.map( (listItem,index) => (
                    <li key={index}>
                        <a href={listItem.link}>{listItem.linkName}</a>
                    </li>
                ))}
            </ul>
        </>
    )
}



function Header() {
  
    return (
    <>
        <header>
            {/* grey header */}
            <div class='container main-header'>
                <div class="mw-900 parent-container">
                    <h1>Push Notification Control Panel</h1>
                    <Navlinks/> 
                </div>
            </div>
            {/* purple header  */}
            <div class='container secondary-header'>
                <div class='mw-900'></div>
            </div>

        </header>
    </>
    );
  }

  export {Header}
